/* eslint-disable prettier/prettier */
import React from 'react'
import Home from '../Home';
import Test_1 from '../Test_1';
import Login from '../Login';
import Register from '../Register';
import { createStackNavigator } from '@react-navigation/stack';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import Colors from '../../contents/colors/Colors';
import Icon  from 'react-native-vector-icons/MaterialCommunityIcons';
import SellItem from '../SellItem';


const BottomTab = createMaterialBottomTabNavigator()

const HomeStack = createStackNavigator()

function HomeNavigation() {
  return (
      <HomeStack.Navigator>
        <HomeStack.Screen name="SellItem" component={SellItem}/>
        <HomeStack.Screen name="Home2" component={Home} options={{headerShown: false}}/>
      </HomeStack.Navigator>
  )
}

export default function TabNavigation() {
  return (
        <BottomTab.Navigator
          initialRouteName="Home"
          activeColor="black"
          inactiveColor= {Colors.DEFAULT_GRAY}
          barStyle={{ backgroundColor: 'white' }}>
          <BottomTab.Screen 
            name="Home" 
            component={HomeNavigation}
            options={{
              tabBarLabel: 'Home',
              tabBarIcon: ({ color }) => (
                <Icon name="home" color={color} size={26} />
              ),
            }} />
          <BottomTab.Screen 
            name="Test 1" 
            component={Test_1}
            options={{
              tabBarLabel: 'Compass',
              tabBarIcon: ({ color }) => (
                <Icon name="compass" color={color} size={24} />
              ),
            }} />
          <BottomTab.Screen 
            name="Register" 
            component={Register}
            options={{
              tabBarLabel: 'Compass',
              tabBarIcon: ({ color }) => (
                <Icon name="compass" color={color} size={24} />
              ),
            }} />
          <BottomTab.Screen 
            name="Login" 
            component={Login}
            options={{
              tabBarLabel: 'Compass',
              tabBarIcon: ({ color }) => (
                <Icon name="compass" color={color} size={24} />
              ) ,
            }} />
        </BottomTab.Navigator>
  )
}
